import { createStore, applyMidlleware } from 'redux';
import logger from 'redux-logger';

 import rootReducer from './rootReducer';

 const middlewares = [
    logger
 ]

 const store = createStore(rootReducer, applyMidlleware(...middlewares));

 export default store;
